import React, { useState } from 'react'
import './Todo.css';
const Todo = () => {
    const [datas, setDatas] = useState([
        { content: "hai" },
        { content: "hai" },
        { content: "hai" },
        { content: "hai" }
])
  return (
    <div className='todo'>
        <h1>Simple Todo</h1>
        <div className='todo_container'>
            <div className='todo_container-top'>
                <input className='todo_container-top-input' type="text" placeholder='Enter a task' />
                <button className='todo_container-top-add'>Add</button>
            </div>
            <div class="todo_page-middle">
                {
                    datas.map((item,index)=>{
                        <div className='todo_page-middle-tasks'>
                            <p class="task-content">{item}</p>
                            <button class="task-mark">Mark</button>
                            <button class="task-delete">Delete</button>
                        </div>
                    })
                }
            </div>
        </div>
    </div>
  )
}

export default Todo
